        .should('exist')
        .find('.guided-help-card-content')
        .should('be.visible')
        .find('link-list')
        .find('.link-list-item dds-link')
        .should('have.length', 5)
        .each($link =>
          links.push(Cypress.$($link[0].shadowRoot).find('a').text())
        );

      cy.wrap(links).should('deep.equal', [
        'View Endpoints',
        'Add Application',
        'Deploy Applications',
        'Create Rule',
        'ESE Connectivity',
      ]);
    });
